      other Federal Election Activity.  The individuals who maintain these tables
      are not employees of the committee and therefore not subject to 11 CFR 300.33(c)(2).    The
      employees reported on H4 do not spend more than 25% of their time on federal
      election activity and therefore are not subject to 11 CFR 300.33(c)(2).  The
      payments to individuals for office cleaning and computer consulting reported
      on H4 are not employees of the committee and therefore are not subject to 11
      CFR 300.33(c)(2).    The petty cash disbursements account is used for cash expenditures
      which do not exceed $100.00 to any person or purchase transaction.  No disbursements
